import styled from 'styled-components';

export const Section = styled.section`
    background: #000d1a;
    height: 100vh;
    max-height: 1100px;
    position: relative;
    overflow: hidden;
`;

export const Container = styled.div`
    background: #fff;
    padding: 3rem 2rem;
    position: relative;
`;

export const Wrap = styled.div`

`;

export const Content = styled.div`

`;

export const Image = styled.img`
     position: absolute;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;
    object-fit: cover;
`;
